import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div className="home">
      <h1>Project Showcase</h1>
      <p>Created by Aryan Singh</p>
      <Link to="/projects">View Projects</Link>
    </div>
  );
}

export default Home;
